column8:
送料無料！<BR>高級感あるアンティーク調ウッドポットが人気！<BR>
足元にはシックで高級感のあるアンティーク調ウッドポットが特徴！<BR>従来のツリーより最大直径幅を約22ｃｍ短くした省スペースタイプツリー！<BR>高さの有るツリーを飾れるのがスリムタイプクリスマスツリーの魅力です。<BR>今年のXmasはワンランク上のツリーをどうぞ！<BR>毎年早めに売り切れてしまう大人気のツリーです。<BR>
●サイズ：Ｈ１８０×Ｗ７８ｃｍ<BR>
●ポットSize高さ２４ｃｍ×幅２５．５cm×奥行き２５．５ｃｍ<BR>

梱包収納サイズ：<BR>
高さ35ｃｍ長さ85.5ｃｍ奥行き28.5ｃｍ当店では、御安心してお買いものして頂く為に出荷の際には全て点灯検査確認にして発送致します。<br>
全ての商品に<font color="#FF00FF">1年間保証サービス一部2年間保証</font>をお付けいたしております。<br>

